import React, { useState } from "react";
import "./App.css";
import Card from "./components/UI/Card";
import QuestionsCarousel from "./components/QuestionsCarousel";
import QA from "./data";

function App() {
  const [data, setData] = useState("");

  setData(QA);

  return (
    <div className="App">
      <Card>
        <QuestionsCarousel />
      </Card>
    </div>
  );
}

export default App;
